DELIMITER $$
CREATE TRIGGER `employee_update` AFTER UPDATE ON `oms_employee_info` FOR EACH ROW BEGIN
  IF OLD.joining_date <> NEW.joining_date THEN
    INSERT INTO oms_employee_log (employee_id, field_name, old_value, new_value, changed_by, changed_on)
    VALUES (OLD.id, 'joining_date', OLD.joining_date, NEW.joining_date, NEW.edited_by, NEW.edited_on);
  END IF;

  IF OLD.joining_date_bs <> NEW.joining_date_bs THEN
    INSERT INTO oms_employee_log (employee_id, field_name, old_value, new_value, changed_by, changed_on)
    VALUES (OLD.id, 'joining_date_bs', OLD.joining_date_bs, NEW.joining_date_bs, NEW.edited_by, NEW.edited_on);
  END IF;

  IF OLD.termination_date <> NEW.termination_date THEN
    INSERT INTO oms_employee_log (employee_id, field_name, old_value, new_value, changed_by, changed_on)
    VALUES (OLD.id, 'termination_date', OLD.termination_date, NEW.termination_date, NEW.edited_by, NEW.edited_on);
  END IF;

  IF OLD.pan_no <> NEW.pan_no THEN
